class User {
  String name;
  String userName;
  String password;
  String image;
  int age;

  User({@required this.name, this.userName, this.password, this.age, this.image = ""});

  Uint8List getUserImage() {
    if (image.length < 100) {
      return getUnknownUserImage();
    } else {
      return base64.decode(image);
    }
  }
}

